import React from 'react'
import Slider from 'react-animated-slider'

const content = [
    {
        title: 'pH Value',
        description: 'The normal Range for pH in surface water system is 6.5 to 8.5'
    },
    {
        title: 'Oxygen Value',
        description: 'Healthy water should generally have D.O. concentrations above 6.5-8 mg/L and between about 80-120%.'
    },
    {
        title: 'Turbidity Value',
        description: 'Turbidity value of drinking water should not be more than 5 NTU, and should ideally be below 1 NTU.'
    }
];

const TeamSlider = () => {
    return (
        
            <Slider className="SliderWrap">
                <div className='SliderContent'>
                    <div className='inner'>
                        <div class="slide first">
                            <h1>Oxygen Value</h1>
                            <p>Healthy water should generally have D.O. concentrations above 6.5-8 mg/L and between about 80-120%.</p>
                        </div>
                        <div class="slide">
                            <h1>pH Value</h1>
                            <p>The normal Range for pH in surface water system is 6.5 to 8.5</p>
                        </div>
                        <div class="slide">
                            <h1>Turbidity Value</h1>
                            <p>Turbidity value of drinking water should not be more than 5 NTU, and should ideally be below 1 NTU.</p>
                        </div>
                    </div>
                </div>
                
            </Slider>
        
        // 
        //https://codesandbox.io/s/p582xl40j?file=/index.js 
    )
}

export default TeamSlider
